import React from 'react';
import { useNavigate } from 'react-router-dom';
import img from '../child2-01.png';
import add from '../numbers/add-01.png';
import adbstract from '../numbers/adbstract-01.png';
import equal from '../numbers/equal-01.png';
import five from '../numbers/five-01.png';
import '../style.css';
const Accueil = ()=>
{
    return (
        <div className='container'style={{height:"100vh"}}>
            <div className='card shadow parent'>
                <div className='card col-6 bg-description description p-3 shadow'>
                <h3>calculate game</h3>
                commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content. <br/>
                Lorem ipsum may be used as a placeholder before the final copy is available. It is also used to temporarily replace text in a process called greeking, <br/>
                which allows designers to consider the form of a webpage or publication, without the meaning of the text influencing the design
                </div>
                <div>
                    <button  className='btn-start button-74'>start</button>
                </div>
                <img className='add' src={add} alt='add'></img>
                <img className='adbstract' src={adbstract} alt='adbstract'></img>
                <img className='equal' src={equal} alt='equal'></img>
                <img className='five' src={five} alt='five'></img>
                <img style={{width:"100%"}} src={img} alt='home'></img>
            </div>
            
        </div>
    )
}

export default Accueil
